scan># - start scanning. # - vk user ID;

"s" - statistics for the current day;

"s#" - statistics for a certain number of days, where # is the number of days. For example, s10;

"YYYY-MM-DD" - statistics for a specific day, where YYYY is the year, MM is the month, and DD is the day. For example, 2021-01-31.
